def find_primes_between_indices(input_list):
    def is_prime(n):
        if n <= 1:
            return False
        if n == 2:
            return True
        if n % 2 == 0:
            return False
        i = 3
        while i * i <= n:
            if n % i == 0:
                return False
            i += 2
        return True
    return sorted([x for x in input_list[3:9] if is_prime(x)])
